import React, { Component } from "react";

class LeftPanel extends Component {
  state = {};
  render() {
    return (
      <div id="leftpanel">
        <div id="view_options">
          <a href="www.splitwise.com" id="dashboard_option" className="open">
            Dashboard
          </a>
          <div className="group_tags">
            <div className="header">
              GROUPS
              <a id="add_group" href="www.spitwise.com">
                + Add
              </a>
            </div>
            <a href="www.splitwise.com" className="group_name">
              {" "}
              <i className="icon-tag"></i> CodingMart Fellas
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default LeftPanel;
